        "kmf = KaplanMeierFitter()\n",
        "\n",
        "# 2. Fit the data: Time is 'tenure', Event is 'Churn'\n",
        "kmf.fit(durations=df['tenure'], event_observed=df['Churn'], label='Global Retention')\n",
